import React, { Component } from 'react';
import { Card, Icon } from 'semantic-ui-react'
import 'test_tweet.json'

class Test extends Component {
  render() {
    return (
      <Card>
        <Card.Content header='Test Header' />
        <Card.Content description='Test description' />
        <Card.Content extra>
          <Icon name='user' />
          4 Friends
        </Card.Content>
      </Card>
    );
  }
}


export default Test;
